$(document).ready(function(){_rcBaseUrl&&($("a.rclink span").text("Contacting..."),$.ajax(_rcBaseUrl+_rcItemsUrl,{dataType:"jsonp",crossDomain:!0}).done(function(n){$("a.rclink").show().find("span").text("("+n.length+")");$.each(n,function(n,t){$("#"+t.route).attr("href",_rcBaseUrl+this.url).removeClass("invisible")})}).fail(function(n){$("a.rclink span").text("Contact failed with error "+n.status).addClass("validation-summary-errors")}))});